var CityClass = {
    /* 属性初始化 */
    init_prov : '', //省ID
    init_city : '', //市ID
    init_area : '', //县\区ID
    obj_province : '',      //省 表单控件ID名称
    obj_city     : '#city', //市 表单控件ID名称
    obj_area     : '#area', //县\区 表单控件ID名称
    city_db      : {},      //城市数据库
    error        : 0,       //错误数量
    /* 方法 */
    init: function(config) {
        if(undefined == config || '' == config || $.isEmptyObject(config)) {
            this.error += 1;
        } else {
            this.init_prov = config.init_prov;
            this.init_city = config.init_city;
            this.init_area = config.init_area;
            this.obj_province = config.obj_province;
            this.obj_city = config.obj_city;
            this.obj_area = config.obj_area;
        }
        if($.isEmptyObject(this.city_db) || $(this.obj_province).length<=0 || $(this.obj_city).length<=0 || $(this.obj_area).length<=0) {
            this.error += 1;
        }
        if(this.error > 0) {
            alert('数据初始化失败~');
            return false;
        }
        _self = this;
        this.bindProvince(this.obj_province, this.init_prov);
        this.bindCity(this.obj_city, $(this.obj_province).val(), this.init_city);
        this.bindArea(this.obj_area, $(this.obj_city).val(), this.init_area);
        $(this.obj_province).on('change', function() {
            _self.init_prov = $(this).val(), _self.init_city = '', _self.init_area = '';
            _self.bindCity(_self.obj_city, $(this).val());
            _self.bindArea(_self.obj_area);
        });
        $(this.obj_city).on('change', function() {
            _self.init_city = $(this).val();
            _self.bindArea(_self.obj_area, $(this).val());
        });
    },

    bindProvince: function(objName, initValue) {
        var province = $(objName);
        var city_db  = this.city_db;
        province.html("<option value=''>=请选择=</option>");
        $(city_db).each(function(index) {
            if (0 == city_db[index].parent_id) {
                province.append("<option value='" + city_db[index].id + "'>" + city_db[index].area_name + "</option>");
            }
        });
        if(undefined == initValue || '' == initValue  || 0 == initValue) {
            province.get(0).selectedIndex = 0;
        } else {
            province.val(initValue);
        }
        return true;
    },

    bindCity : function(objName, pid, initValue) {
        var city    = $(objName);
        var city_db = this.city_db;
        city.html("<option value=''>=请选择=</option>");
        if(undefined == pid || '' == pid) {
            city.get(0).selectedIndex = 0;
            return false;
        }
        $(city_db).each(function(index) {
            if (0 != city_db[index].parent_id && pid == city_db[index].parent_id) {
                city.append("<option value='" + city_db[index].id + "'>"+ city_db[index].area_name +"</option>");
            }
        });
        if(undefined == initValue || '' == initValue  || 0 == initValue) {
            city.get(0).selectedIndex = 0;
        } else {
            city.val(initValue);
        }
        return true;
    },

    bindArea : function(objName, cid, initValue) {
        var area = $(objName);
        var city_db = this.city_db;
        area.html("<option value=''>=请选择=</option>");
        if(undefined == cid || '' == cid) {
            area.get(0).selectedIndex = 0;
            return false;
        }
        $(city_db).each(function(index) {
            if (0 != city_db[index].parent_id && cid == city_db[index].parent_id) {
                area.append("<option value='" + city_db[index].id + "'>"+ city_db[index].area_name +"</option>");
            }
        });
        if(undefined == initValue || '' == initValue  || 0 == initValue) {
            area.get(0).selectedIndex = 0;
        } else {
            area.val(initValue);
        }
        return true;
    }
};

